('IN', 'India', 'Republic of India', 'IND', 356, 'AS', '<p><strong><a href=\"http://www.studyabroad.com/cfs-file.ashx/__key/CommunityServer.Components.UserFiles/00.00.00.55.22.Attached+Files/7144.india5.jpg\"><img alt=\"\" src=\"http://www.studyabroad.com/resized-image.ashx/__size/550x0/__key/CommunityServer.Components.UserFiles/00.00.00.55.22.Attached+Files/7144.india5.jpg\" /></a></strong></p>\r\n\r\n<p></p>\r\n\r\n<p><strong>Touchdown in India</strong></p>\r\n\r\n<p>You&#39;re on your way to study overseas, waiting anxiously as your plane is finally about to touch down. When you climb off the plane, you&#39;ll be welcomed by friendly natives with a flower garland around your neck, but you&#39;re not in Hawaii, or in any Caribbean location-you&#39;re studying abroad in the vastly fascinating and educational destination of India. Lucky you!</p>\r\n\r\n<p>Mark Twain said that, &quot;India is the cradle of the human race, the birthplace of human speech, the mother of history, the grandmother of legend and the great-grandmother of tradition.&quot; He wasn&#39;t exaggerating, either, and as you study abroad in India, you&#39;ll find that out for yourself.</p>\r\n\r\n<p><strong>Hi-Tech Higher Ed</strong></p>\r\n\r\n<p>Higher education in India still has many reforms in the works, as it grows along with the booming economy. The country provides support for research, and emphasizes an educated workforce with a commitment to lifelong learning. Students who study abroad in India and focus on technology and the sciences will find the destination a no-brainer, as India has been a leader in the fields of the sciences, mathematics and technology for thousands (yes, literally thousands) of years:</p>\r\n\r\n<ul>\r\n	<li>The number system was invented in India, and Aryabhatta came up with the ever-important concept of &quot;zero&quot;</li>\r\n	<li>&quot;Ayurveda&quot; was the world&#39;s earliest medical system, and Susruta, the &quot;father of surgery,&quot; performed complex surgeries 2,600 years ago</li>\r\n	<li>Vinod Dahm created the Pentium chip, Viond Khosla is the co-founder of Sun Microsystems and Sabeer Bhatia is the co-founder and creator of Hotmail</li>\r\n</ul>\r\n\r\n<p>If you like technology you&#39;ll want to go to Bangalore, the &quot;Silicon Valley&quot; of India, where you can visit the Visveswaraiah Technological and Industrial Museum. You&#39;ll be surprised to learn just how much India&#39;s excellence in the sciences and technology has impacted the United States. The 3.22 million Indians living in the U.S. have become:</p>\r\n\r\n<ul>\r\n	<li>38 percent of the doctors in the U.S.</li>\r\n	<li>36 percent of the NASA employees in the U.S.</li>\r\n	<li>34 percent of Microsoft employees in the U.S.</li>\r\n	<li>28 percent of IBM employees in the U.S</li>\r\n</ul>\r\n\r\n<p>In a study abroad program in India, you can choose to concentrate on any of the country&#39;s<em>other</em>strong areas, including:</p>\r\n\r\n<ul>\r\n	<li>Medicine</li>\r\n	<li>Nuclear energy</li>\r\n	<li>Astronomy</li>\r\n	<li>Biotechnology</li>\r\n	<li>Oceanography</li>\r\n	<li>Engineering</li>\r\n	<li>Management</li>\r\n</ul>\r\n\r\n<p>In addition, Indians have a high regard for animals and trees-the Hindus even worship them- and consequently, environmental students will want to check out:</p>\r\n\r\n<ul>\r\n	<li>Wildlife such as elephants, camels, leopards, lions, rhinos and the national animal, the Bengal tiger</li>\r\n	<li>The majestic Himalayan Mountains in the north, including Mt. Everest (climb it if you dare!) and the unique surrounding plant and animal life</li>\r\n	<li>Ranthambore National Park in Rajasthan, Hazaribagh Wildlife Sanctuary in Bihar and Jim Corbett National Park in Andaman</li>\r\n</ul>\r\n\r\n<p>A study abroad program in India will also expose you to a fascinating culture, ancient architecture and the amazing history of a country that has been growing and evolving on its own, because it hasn&#39;t invaded another country in the past 10,000 years. Plus, watch the very idea of color come alive as more vibrant tones than you ever imagined jump out at you from every shirt, building and flower.</p>\r\n\r\n<p><strong>History and Harmony</strong></p>\r\n\r\n<p>As you get to know the country, your study abroad program in India will allow you to learn while having fun. You&#39;ll easily make new friends with the tolerant and hospitable Indian people. In the &quot;land of the gods,&quot; you&#39;d be wise to learn the traditional formal greeting that is known as &quot;Namaste.&quot; Namaste involves placing both hands together raised below your face, and is a respectful greeting for elders and strangers.</p>\r\n\r\n<p>Many of the people you will meet may live in the capital city of Delhi, where you will see the contrast between Old and New Delhi:</p>\r\n\r\n<ul>\r\n	<li>Visit the India Gate, Jama Masjid and the Lotus Temple</li>\r\n	<li>Shop &#39;til you drop at Connaught Place, the Palika Bazar or the Dilli Haat</li>\r\n	<li>Get some of that famous Masala, a combination of garlic, onion, tomato, ginger and spices, mixed with meat, fish or vegetables in a creamy sauce</li>\r\n</ul>\r\n\r\n<p>Bangalore is another city full of history, as well as a modern nightlife. This cosmopolitan &quot;garden city&quot; boasts the La Bagh gardens, which stretch over 240 acres. Admire the Dravidian style of the ancient granite structure known as the Vidhana Soudha before letting loose at the Nritya Gram dance center.</p>\r\n\r\n<p>You will find plenty to do outside of the major cities, whether it&#39;s a jungle safari at the Manas tiger Reserve of Assam or taking in one of India&#39;s Bollywood films or one of its many and very celebrated festivals. (Does Diwali ring a bell, fans of<em>The Office</em>?)</p>\r\n\r\n<ul>\r\n	<li>Sun bathe on the beaches of the Arabian Sea and the Bay of Bengal, where you will find sport, relaxation, fresh seafood and spas</li>\r\n	<li>Visit Jaipur, &quot;the pink city,&quot; named that because of its terra cotta-covered walls and buildings, including the City Palace, the Amber Fort and Hawa Mahal</li>\r\n	<li>Don&#39;t miss the famous Taj Mahal, a mausoleum built by a broken-hearted Emperor Shah Jahan for his beloved second wife, who died in childbirth</li>\r\n</ul>\r\n\r\n<p>You never knew that the Taj Mahal is one of the world&#39;s biggest love letters, huh? Well, there is a lot more you don&#39;t know and can learn when you study abroad in India. So, sit back, relax and enjoy the rest of your flight. You&#39;re in for the most vibrant time of your life!</p>\r\n', 'Y'),
