(32, 'AfterRegistration', 'Registration Confirm Mail', '<p><img src=\"../../../assets/images/mrtheo_logo.png\" alt=\"\" width=\"298\" height=\"81\" /></p>\r\n<p>?</p>\r\n<p>REPLY FROM Mrtheo Yellow Pages</p>\r\n<p>Thank you {full_name} to join with us,</p>\r\n<p>Your,</p>\r\n<p>Login ID : {email}</p>\r\n<p>Password : {pwd}</p>\r\n<p>?</p>', 'Y'),
(33, 'ForgetPassword', 'Forget Password', '<p><img src=\"../../../assets/images/mrtheo_logo.png\" alt=\"\" width=\"298\" height=\"81\" /></p>\r\n<p>?</p>\r\n<p>REPLY FROM Mrtheo Yellow Pages</p>\r\n<p>Hello {full_name} ,</p>\r\n<p>Your New Password is,</p>\r\n<p>Password : {pwd}</p>\r\n<p>?</p>', 'Y'),
