INSERT INTO `serv_knowledge` (`id`, `title`, `content`, `knowledge_type`, `order`, `meta_title`, `meta_key`, `meta_description`, `status`) VALUES
(1, 'Creating Your Profile ?', '<p>To sign up on odesk-clone.com and create your profile:<br />\r\n1. Click on theSign up and Continue at the top of the odesk-clone.com website.<br />\r\n2. In sign up to create your Contractor account is to select the membership level.<br />\r\n<br />\r\nCongratulations, you have now joined the?odesk-clonein online work! Next you will want to setup and customize your online profile. To finish customizing your profile please follow these steps:<br />\r\n1. Go to the left navigation bar of?odesk-clone?and click on My Profile.<br />\r\n2. Complete your basic information.<br />\r\n3. Then its time to get the profile started. On the next page you will upload your thumbnail photo, create a tagline, enter in a minimum hourly rate, create a contractor overview and enter in your skills.<br />\r\nHere is what your completed profile will look like.</p>\r\n', 1, 0, '', '', '', 'Y'),
(3, 'Look of Your Profile to Friends and Potential Clients  ', '&lt;p&gt;\r\n	Now after Completing the profile The look of the profile that Your Friends and Potential Clients can see is :&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n', 1, 2, '', '', '', 'Y'),
(22, 'Upgrading Membership', '<p>To upgrade your current membership:<br />\r\n1. Click the Membership Plan button in the Dashboard.<br />\r\n2. Click the Membership link on the left panel.<br />\r\n3. Update your plan details. (The monthly cost will update at the bottom of the page)<br />\r\n4. Click Submit.<br />\r\n5. If appropriate, It will deduct amount from your current balance and update your membership.</p>\r\n\r\n<p>6. You can have auto membership plan updation by clicking on the checkbox.</p>\r\n\r\n<p>7. Later this auto membership plan updation could be edited through edit profile.</p>\r\n', 13, 1, '', '', '', 'Y'),
(4, 'Searching the Jobs Index', '&lt;p&gt;After you have created your contractor profile,you can start submitting proposals&amp;nbsp;for jobs.&amp;nbsp;You can find and evaluate jobs by browsing the odesk-clone&amp;nbsp;site or by receiving invitations from potential clients to submit proposals for their jobs.&lt;br /&gt;\r\nTo browse jobs:&lt;br /&gt;\r\n1. Go to \'Find Work\' on the top navigation bar and choose Search Jobs .&lt;br /&gt;\r\n2. You can browse jobs by a number of criteria:&lt;br /&gt;\r\nCategory&lt;br /&gt;\r\nLatest Job&lt;br /&gt;\r\nJob Name&lt;br /&gt;\r\n3.&amp;nbsp;Click the Job Name&amp;nbsp;to view a particular job description.&lt;br /&gt;\r\n4. For additional information about a client, click on client\'s username.&lt;br /&gt;\r\nIn addition to actively browsing odesk-clone&amp;nbsp;for jobs, you can also can create saved searches for jobs in your categories of interest and&amp;nbsp;receive daily email&amp;nbsp;notifications. For more information on , please click here.&lt;/p&gt;', 8, 0, '', '', '', 'Y'),
(8, 'Browsing Contractors ', '<p>Optionally, you can solicit bids from contractors by browsing their profiles and requesting proposals for your job. Note: It is not required that you request proposals from contractors; you can also post a job for open bidding as outlined in the previous section.<br />\r\nTo browse contractor profiles:<br />\r\n1. On the home page, select the Hire in the top navigation bar and then click Search Contractors. You can enter a keyword (EX: iPhone, PHP) and click the Search button to narrow your search results.<br />\r\n2. You can filter the search results using the options in the left navigation. Sort by clicking on the dropdown to the right of Sort by: at the top of the page.</p>\r\n\r\n<p><a href=\"http://www.odesk-clone.com/demo/singup.html\">http://www.odesk-clone.com/demo/singup.html</a></p>\r\n', 8, 0, '', '', '', 'Y'),
(6, 'Post a Job', '<p>To post jobs on Detect&amp;Go.com, click the Project button in the upper left corner of the home page.<br />\r\n1. Select PostProject option from the drop down menu<br />\r\n2. First you will need to fill in your account details. Please fill out fields marked * ,they are mandatory, if you have any questions along the way look for the tip that will appear to the right of each box for additional information.Click here to view post a job<a href=\"http://www.odesk-clone.com/demo/postjob.html\">http://www.odesk-clone.com/demo/postjob.html</a></p>\r\n\r\n<p><br />\r\n3. Next you will be prompted to create your job post and then click continue. Remember to be as detailed and specific as you can.<br />\r\n4. Enter a title for your job.<br />\r\n5. Enter a job description. Be as detailed as possible, including specific information about the work needed, the size of the job, estimated start and completion dates, and some background on your company. You also have access to a number of job description templates by using our Description Assistant. If you select a template and you no longer want to use it, you can remove the template to revert back to your original text and selections by choosing the undo button.<br />\r\n6. You may attach up to 10 files (maximum size 50 MB per attachment) that help clarify the job requirements and enable contractors to prepare more thorough, relevant proposals.<br />\r\nPlease use discretion when including private information such as your web address or name.<br />\r\n7. Select a Fixed price or Hourly job. Fixed price jobs are best when you have well-defined scope and structure for the work. If the job scope is less certain and you would like to work with your contractor on a more flexible basis, then choose the hourly option. Hourly jobs are Work View enabled. Work View is a safe and efficient way to pay for hourly work online. You will also be asked to select your budget. You will have the option to choose from a set of predefined budget ranges or you can create your own custom range.<br />\r\n8. Select the category and subcategory that best describe your job and the skill set you would like your contractor to have.<br />\r\nWhen you post a job in a subcategory, it will be viewed by all contractors in the main category.<br />\r\n9. You may select up to 5 relevant skills you would like your contractor to have or groups that you would like your contractor to have joined. When you select skills, your job will be tagged with the associated keywords, making it more visible to qualified contractors when they are searching our job database.</p>\r\n', 8, 1, '', '', '', 'Y'),
(7, 'Signing Up with odesk-clone', '&lt;p&gt;To sign up on odesk-clone&amp;nbsp;and create your profile:&lt;br /&gt;\r\n1. Click on theSign up and Continue at the top of the odesk-clone.com website.&lt;br /&gt;\r\n2. In sign up to create your Contractor account is to select the membership level.&lt;br /&gt;\r\nCongratulations, you have now joined the odesk-clone&amp;nbsp;in online work! Next you will want to setup and customize your online profile. To finish customizing your profile please follow these steps:&lt;br /&gt;\r\n1. Go to the left navigation bar of odesk-clone&amp;nbsp;and click on My Profile.&lt;br /&gt;\r\n2. Complete your basic information.&lt;br /&gt;\r\n3. Then its time to get the profile started. On the next page you will upload your thumbnail photo, create a tagline, enter in a minimum hourly rate, create a contractor overview and enter in your skills.&lt;br /&gt;\r\nHere is what your completed profile will look like.&lt;/p&gt;', 8, 0, '', '', '', 'Y'),
(9, 'Requesting Proposals from odesk-clone Contractors', '<p>You can easily send requests to Detect&amp;Go.com contractors to submit proposals for your job, either from search results or from their individual profiles.<br />\r\n</p>\r\n\r\n<p>Requesting contractor proposals from search results: You can invite a contractor by clicking on the Red Invite button. If you already have active postings, you will see a window listing all of your jobs that are open for bidding. You can either choose an existing job or create a new one. Each selected service contractor will receive an email invitation to submit their proposal for your job.</p>\r\n\r\n\r\n', 8, 1, '', '', '', 'Y'),
(17, 'Getting Hired', '&lt;p&gt;If the client selects your proposal and hires you for the job, the following will occur:&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;You will receive an email notification informing you that you have been selected.&lt;/li&gt;\r\n    &lt;li&gt;The job can be found on your Dasboardl with Accept and Decline options.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;You must then accept the job selection on odesk-clone&amp;nbsp;before the job can begin.&lt;/p&gt;', 8, 0, '', '', '', 'Y'),
(18, 'Accepting Jobs', '&lt;p&gt;\r\n	To accept the job:&lt;br /&gt;\r\n	1. Click the Accept button on Dashboard .&lt;br /&gt;\r\n	2. Click on the link for accepting job in the email.&lt;/p&gt;\r\n', 8, 1, '', '', '', 'Y'),
(19, 'Sending Pay request to the Client', '<p>To Request for Pay to the client:<br />\r\n1. Go to the Fund Management link in the left navigation and click Milestone.<br />\r\n2. Select the job for which you want to send an request and click on action and select the request .<br />\r\n3. Click on Submit.</p>\r\n', 8, 0, '', '', '', 'Y'),
(20, 'Confirming Payment', '&lt;p&gt;\r\n	To Confirm the Payment:&lt;br /&gt;\r\n	1. Go to the Fund Management link in the left navigation and click Milestone.&lt;br /&gt;\r\n	2. Select the job for which you want to send an request and click on accept amount .&lt;br /&gt;\r\n	3. Click on Submit.&lt;/p&gt;\r\n', 8, 1, '', '', '', 'Y'),
(21, 'Withdrawing Funds', '<p>\r\n	To withdraw the Payment:<br />\r\n	1. Go to the Fund Management link in the left navigation and click Withdraw Funds.<br />\r\n	2. Select the paypal and give the details for the withdrawal of money.<br />\r\n	3. Click on click here to withdraw.<br />\r\n	4. Mention the required details.</p>\r\n', 8, 2, '', '', '', 'Y');
