INSERT INTO `serv_mailtemplate` (`id`, `langid`, `type`, `subject`, `template`, `status`) VALUES
(1, 'en', 'registration', 'Registration', '<p><strong>Hi {username},</strong></p>\n\n<p>Welcome to eDesk, let&#39;s begin! First things first:</p>\n\n<p><a href=\"{copy_url}\"><strong>Click here</strong></a> to verify your email address and activate your account; alternatively, copy and paste the link below in the address bar of your web browser</p>\n\n<p>{copy_url}</p>\n\n<p><strong>Account Details:</strong></p>\n\n<p>Username: {username}</p>\n\n<p>password: {password}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(2, 'en', 'forgot_password', 'Forgot Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\n\n<p>Did you request to change your password?&nbsp;</p>\n\n<p><a href=\"{url}\">Click Here</a> to reset your password, or copy and paste the following url in your browser&#39;s address bar:</p>\n\n<p>{url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(19, 'en', 'new_job_post', 'A New Job Posted', '<p><strong>Hello Admin,</strong></p>\n\n<p>A new job has been posted and waiting for your approval.</p>\n\n<p>Job Title : {title}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(3, 'en', 'change_password', 'Password Change', '<p><strong>Dear {username},</strong></p>\n\n<p>\\r\\n</p>\n\n<p>You successfully change your password. Below are your account details after password change</p>\n\n<p>\\r\\n</p>\n\n<p><strong>Account Details:</strong></p>\n\n<p>\\r\\n</p>\n\n<p>Username: {username}</p>\n\n<p>\\r\\n</p>\n\n<p>password: {password}</p>\n\n<p>\\r\\n</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(4, 'en', 'bid_on_job_for_employe', 'Bid On Your Project', '<p><strong>Dear {username},</strong></p>\n\n<p>{freelancer} bid on the project {project}</p>\n\n<p><strong>Bid Details:</strong></p>\n\n<p>Project Name: {project}</p>\n\n<p>Project Url: {project_url}</p>\n\n<p>Amount: {amount}</p>\n\n<p>Duration: {duration}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(5, 'en', 'bid_reverse_for_employe', 'Reverse Bid On Your Project', '<p><strong>Dear {username},</strong></p>\n\n<p>{freelancer} revised the bid on the project {project}</p>\n\n<p><strong>Bid Details:</strong></p>\n\n<p>Project Name: {project}</p>\n\n<p>Project Url: {project_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(76, 'en', 'add_fund_client', 'Fund added by Client', '<p>Hello {name},</p>\r\n\r\n<p>Congratulations..</p>\r\n\r\n<p>Admin added ${amount} to your account. Go check your account.</p>\r\n\r\n<p>Dear user, you paid a total of ${amount}, our fee is ${amount} (5%) and we added ${amount} to your account.&nbsp; (There is no image for this item).</p>\r\n\r\n<p>Thank you for your business,</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(6, 'en', 'bid_on_job_for_freelancer', 'Bid on project', '<p><strong>Dear {username},</strong></p>\n\n<p>You successfully bid on project {project}</p>\n\n<p><strong>Bid Details:</strong></p>\n\n<p>Project Name: {project}</p>\n\n<p>Project Url: {project_url}</p>\n\n<p>Amount: {amount}</p>\n\n<p>Duration: {duration} days</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(7, 'en', 'bid_reverse_for_freelancer', 'Reverse Bid On Project', '<p><strong>Dear {username},</strong></p>\n\n<p>You successfully revised your bid on project {project}</p>\n\n<p><strong>Bid Details:</strong></p>\n\n<p>Project Name: {project}</p>\n\n<p>Project Url: {project_url}</p>\n\n<p>Amount: {amount}</p>\n\n<p>Duration: {duration} days</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(9, 'en', 'upgrade_membership', 'SMECLUB: Upgrade Membership', '<p>Hello {username},</p>\n\n<p>Your membership in SME Club has been apgraded to your existing memebership plan.&nbsp;</p>\n\n<p>Membersihp Plan: {plan}.</p>\n\n<p>Membersihp Start: {start}.</p>\n\n<p>Membersihp End: {end}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(10, 'en', 'degrade_membership', 'SMECLUB: Free Membership', '<p>Hello {username},</p>\r\n\r\n<p>This is to inform you that your membership plan is over, you\'re now a free member.</p>\r\n\r\n<p>Please upgrade to access more features.</p>\r\n\r\n<p>Thank you for your business,</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(11, 'en', 'reference', 'Add Reference', '<p><strong>Dear {name},</strong></p>\n\n<p>You has been referenced in Virtualbuddy by {username}.</p>\n\n<p><a href=\"{copy_url}\"><strong>Click Here</strong></a>&nbsp;to give feedback about {username} or navigate with the link below:</p>\n\n<p>{copy_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(12, 'en', 'invite', 'Invite Friend ', '<p><strong>Dear {name},</strong></p>\n\n<p>Welcome onboard. You has been invited in SMEClub by {username} on below mentioned project:</p>\n\n<p>Project name: {project_name}</p>\n\n<p>Please?<a href=\"{copy_url}\"><strong>Click Here</strong></a>?to view this project and work on this project or you can copy paste the bellow link to your browser address</p>\n\n<p>{copy_url}</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>flance.demoscript.website</p>\n', ''),
(13, 'en', 'contact_support', 'Your request has been submitted', '<p><strong>Dear {name},</strong></p>\n\n<p>Thank you for contacting us at eDesk</p>\n\n<p>Your mail id is: {email}</p>\n\n<p>Your support ticket number is: {ticket} and use it for future reference.</p>\n\n<p>We will be in touch with you very soon.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(14, 'en', 'contact_request', 'New Support Request', '<p><strong>Hello Admin,</strong></p>\n\n<p>Welcome again. A new support request has been submitted. Please go through below details:</p>\n\n<p>Name: {name}</p>\n\n<p>Mail Id: {email}</p>\n\n<p>Subject: {subject}</p>\n\n<p>Message: {message}</p>\n\n<p>Support ticket number: {ticket}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(15, 'en', 'invite_freelancer', 'Invite Freelancers', '<p><strong>Dear {name},</strong></p>\n\n<p>You has been invited to join the SMEClub by {username} in the project below:&nbsp;</p>\n\n<p>Project name: {project_name}</p>\n\n<p>Please <a href=\"{project_url}\">click here</a> to view the project or copy and use the link below to nagivate:&nbsp;</p>\n\n<p>{copy_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(63, 'en', 'milestone_request_employer', 'Milestone Request', '<p>Hello {EMPLOYER},</p>\n\n<p>&nbsp; &nbsp;{FREELANCER} has requested a milestone. Kindly check the details and respond appropriately.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(16, 'en', 'withdraw_payment_request_for_freelancer', 'Withdraw Payment Confirmation', '<p><strong>Dear {username},</strong></p>\n\n<p>This is to inform you that your withdrawal request amount (&nbsp;<strong>{cur}</strong> <strong>{</strong>amount<strong>}&nbsp;</strong>) has been approved by the SME Club Support.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(17, 'en', 'close_account_admin', 'Close Account By User', '<p><strong>Hi Admin,</strong></p>\r\n\r\n<p>A user {<strong>username</strong>} has closed his/her account.</p>\r\n\r\n<p>Reason : {<strong>reason</strong>}</p>\r\n\r\n<p><strong>Account Details:</strong></p>\r\n\r\n<p>Username: {username}</p>\r\n\r\n<p>user id: {user_id}</p>\r\n\r\n<p>Thank you for your business,</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(18, 'en', 'close_account', 'Close Account', '<p><strong>Hi {username},</strong></p>\r\n\r\n<p>Your account has been successfully closed. Sign up again if you\'re interested in our services.</p>\r\n\r\n<p>Thank you for your business and for being a valuable user.</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(20, 'en', 'admin_approve_job', 'Job Approved by Admin', '<p><strong>Hello,</strong></p>\n\n<p>Your new postedjob has been approved by admin. Now your job goes live!.</p>\n\n<p>Freelancers can bid on your project.</p>\n\n<p>Job Title : {title}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(21, 'en', 'dispute_notification', 'A New Dispute', '<p><strong>Hello Admin,</strong></p>\r\n\r\n<p>A new dispute has been posted on project: {title} by the client.</p>\r\n\r\n<p>Please check your dispute list for more details.</p>\r\n\r\n<p>Thank you for your business,</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(22, 'en', 'edit_job_notification', 'Project Edit Notification', '<p><strong>Dear {name},</strong></p>\n\n<p>A project, {title} has been modified by the client.</p>\n\n<p><a href=\"{copy_url}\"><strong>Click here</strong></a> to view details of this project or you can copy and paste the link below in your browser address bar:</p>\n\n<p>{copy_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(23, 'en', 'close_job_notification', 'Job Closed', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>The project, {title} has been closed by the client.</p>\r\n\r\n<p>Thank you for your business,</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(24, 'en', 'extend_job_notification', 'Job Extended', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>The project, {title}, expiry date has been extended by the client.</p>\r\n\r\n<p><a href=\"{copy_url}\"><strong>Click here</strong></a> to view details of this project or copy and paste the link below in your browser&#39;s address bar:&nbsp;</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p>Thank you for your business,</p>\r\n\r\n<p>eDesk</p>\r\n', 'Y'),
(25, 'en', 'select_job_notification', 'You have been selected', '<p><strong>Dear {name},</strong></p>\n\n<p>You have ben selected for work on this project, {title}by its client.</p>\n\n<p><a href=\"{copy_url}\"><strong>Click Here</strong></a> to view details of this project or use the link below:</p>\n\n<p>{copy_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(26, 'en', 'process_job_notification', 'Provider Chosen, Job Closed', '<p><strong>Dear {name},</strong></p>\n\n<p>One provider has been chosen for work on project, {title}.The project is now closed for you. You can bid on other projects.</p>\n\n<p><a href=\"{copy_url}\"><strong>Click Here</strong></a> to view all project or navigate with the link below:</p>\n\n<p>{copy_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(27, 'en', 'accept_offer_notification', 'Accept Offer by Provider', '<p><strong>Dear {name},</strong></p>\n\n<p>Congratulation! Your project offer on ,{title} has been accepted by {<strong>username</strong>}.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(28, 'en', 'decline_offer_notification', 'Project Offer Declined', '<p><strong>Dear {name},</strong></p>\n\n<p>Your project offer on ,{title} has been declined by {<strong>username</strong>}.</p>\n\n<p>Your project status is now open and providers can bid on your project again.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(29, 'en', 'milestone_set_notification', 'Milestone is Set', '<p><strong>Dear {name},</strong></p>\n\n<p>A milestone has been set for the project ,{title} by the Bidder.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(30, 'en', 'milestone_release_notification', 'Milestone Released', '<p><strong>Dear {name},</strong></p>\n\n<p>A milestone has been released for the project ,{title} by the client.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(31, 'en', 'milestone_dispute_notification', 'Milestone Disputed', '<p><strong>Dear {name},</strong></p>\n\n<p>A milestone has been disputed for the project ,{title} by the client.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(32, 'en', 'escrow_enable_notification', 'Escrow Enabled', '<p><strong>Hello Admin,</strong></p>\n\n<p>A new escrow is enabled on project: {title} by the client.</p>\n\n<p>Please check your escrow list for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(33, 'en', 'withdrawl_request_notification', 'New Withdraw Requset', '<p><strong>Hello Admin,</strong></p>\n\n<p>A new request for withdrawl amount is submitted by {name}.</p>\n\n<p>Please check your withdrawl list for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(34, 'en', 'job_post_limit_notification', 'Job post limit exhausted', '<p><strong>Dear {name},</strong></p>\n\n<p>You have just completed quota of job post limit. Please upgrade your membership plan for post more job.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(35, 'en', 'bid_limit_notification', 'Bid limit exhausted', '<p><strong>Dear {name},</strong></p>\n\n<p>You have just completed quota of your bids limit. Please upgrade your membership plan for bids on more job.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(36, 'en', 'reset_password', 'Reset Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\n\n<p>Your profile password has been changed successfully. Please visit your profile for more jobs.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(37, 'en', 'add_fund_admin', 'Fund added by Admin', '<p>Hello {name},</p>\n\n<p>Congratulations..</p>\n\n<p>Admin added ${amount} in your account. Go check your account.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(38, 'en', 'milestone_edit_notification', 'Milestone is Edited', '<p><strong>Dear {name},</strong></p>\n\n<p>A milestone has been modified by the Bidder for the project ,{title}.</p>\n\n<p>Please visit your profile for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(39, 'en', 'milestone_fund_request', 'Fund Request', '<p>Hello {name},</p>\n\n<p>Bidder have sent fund request for project&nbsp;{title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(40, 'en', 'milestone_release_payment_request', 'Release Payment Request', '<p>Hello {name},</p>\n\n<p>Bidder has sent release payment request for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(41, 'en', 'milestone_approved_notification', 'Approved Milestone', '<p>Hello {name},</p>\n\n<p>Congratulation!!</p>\n\n<p>Client&nbsp;have been approved your milestone for project?{title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(42, 'en', 'milestone_decline_notification', 'Decline Milestone', '<p>Hello {name},</p>\n\n<p>Client have been decline your milestone for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(43, 'en', 'fund_approved', 'Fund Request Approved', '<p>Hello {name},</p>\n\n<p>Congratulation!!</p>\n\n<p>Client added ${amount} in Escrow Successfully for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(44, 'en', 'fund_declined', 'Fund Request Declined', '<p>Hello {name},</p>\n\n<p>Welcome onboard.</p>\n\n<p>Client decline fund request for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(45, 'en', 'add_fund_escrow', 'Fund Request Approved', '<p><strong>Hello Admin,</strong></p>\n\n<p>Welcome onboard.</p>\n\n<p>A new milestone fund add to Escrow on project: {title} by its client.</p>\n\n<p>Please check your transaction list for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(46, 'en', 'payment_declined_notification', 'Payment Declined Bu Client', '<p>Hello {name},</p>\n\n<p>Welcome onboard.</p>\n\n<p>Client decline payment request for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(47, 'en', 'pm_alert', 'New Message Notification', '<p>Dear {name}<strong>,</strong></p>\n\n<p>Welcome onboard.</p>\n\n<p>You have a new message in your profile. Please log in for more details.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(48, 'en', 'invite_user', 'Invite User', '<p><strong>Dear {name},</strong></p>\n\n<p>Welcome onboard. You&#39;ve been invited to apply:</p>\n\n<p>Project name: {project_name}</p>\n\n<p>Please&nbsp;<strong><a href=\"{copy_url}\">click here</a>&nbsp;</strong>to view the project or copy and paste the link below in your browser address bar.</p>\n\n<p>{copy_url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(49, 'en', 'job_closed_notification', 'Job Closed Notification', '<p>Hello {name},</p>\n\n<p>This email serves to inform you that the client has closed the job for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(50, 'en', 'affiliate_reg', 'Affiliate Registration', '<p><strong>Dear {username},</strong></p>\n\n<p>Welcome and thank you for registering.</p>\n\n<p><a href=\"{copy_url}\"><strong>Click here</strong></a> to verify your email address and activate your account. Or copy the link below and past it in your browser address bar:</p>\n\n<p>{copy_url}</p>\n\n<p><strong>Account Details:</strong></p>\n\n<p>Username: {username}</p>\n\n<p>password: {password}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(51, 'en', 'affiliate_forgot_password', 'Affiliate Forgot Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\n\n<p>Somebody requested a new password for your profile.</p>\n\n<p><a href=\"{url}\">Click Here</a> to reset your password or copy and paste the following url in your browser:</p>\n\n<p>{url}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(52, 'en', 'affiliate_reset_password', 'Reset Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\n\n<p>Your profile password has been changed successfully. Please log in to check all is okay.&nbsp;</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(53, 'en', 'manual_hour_request_freelancer', 'Manual hour requested by freelancer', '<p>Dear {username},</p>\n\n<p>{freelancer} requested manual hour for the project {project}. Please check your project dashboard.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(54, 'en', 'manual_hour_request_accepted', 'Manual hour request accepted', '<p><strong>Dear {username},</strong></p>\n\n<p>Requested manual hour for the project {project} has been accepted. Check your project dashboard.</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>flance.demoscript.website</p>\n', 'Y'),
(55, 'en', 'manual_hour_declined_employer', 'Manual hour request declined by employer', '<p><strong>Dear {username},</strong></p>\n\n<p>Requested manual hour for the project {project} has been declined by Employer. Check your project dashboard.</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>flance.demoscript.website</p>\n', 'Y'),
(56, 'en', 'manual_hour_declined_freelancer', 'Manual hour request declined by freelancer', '<p><strong>Dear {username},</strong></p>\n\n<p>Requested manual hour for the project {project} has been declined by Freelancer. Check your project dashboard.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', 'Y'),
(57, 'en', 'endcontractor', 'End Contact Notification', '<p><strong>Dear {NAME},</strong></p>\n\n<p>{EMPLOYER} end contact with you for the project {PROJECT_NAME}.</p>\n\n<p>Please go to the site and check the feedback.</p>\n\n<p>flance.demoscript.website</p>\n', 'Y'),
(58, 'en', 'newjobsposted', 'Job Suggestions', '<p><strong>Dear {username},</strong></p>\n\n<p>Hope You are doing well</p>\n\n<p>we recommend you some jobs as per your skills , your skills are perfectly match with this job</p>\n\n<p><strong>Job Tittle : {jobtittle},</strong>.</p>\n\n<p><strong>Category : {category},</strong>.</p>\n\n<p><strong>Skills Required : {skills},</strong>.</p>\n\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to apply on this job or just copy and paste the url given below into your browser</p>\n\n<p><strong>{copy_url}</strong></p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>flance.demoscript.website</p>\n', 'Y'),
(59, 'en', 'recontractFreelancer', 'Contract Started', '<p><strong>Dear {username},</strong></p>\n\n<p>Hope You are doing well</p>\n\n<p>Your Contract For the <a href=\"{copy_url}\"><strong>{jobtittle}</strong></a> has Re-started by client.</p>\n\n<p><strong>Job URL :</strong><strong>{copy_url}</strong></p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>flance.demoscript.website</p>\n', 'Y'),
(60, 'en', 'pausecontractFreelancer', 'Contact has been paused', '<p><strong>Dear {username},</strong></p>\n\n<p>Hope You are doing well</p>\n\n<p>Your Contract For the <a href=\"{copy_url}\"><strong>{jobtittle}</strong></a> has been Paused by client.</p>\n\n<p><strong>Job URL :</strong><strong>{copy_url}</strong></p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>flance.demoscript.website</p>\n', 'Y'),
(61, 'en', 'email_verification', 'Email Verification', '<p>Hi {NAME},</p>\r\n\r\n<p>click on the below link to verify your email</p>\r\n\r\n<p>{LINK}</p>\r\n', 'Y'),
(62, 'en', 'withdraw_otp', 'OTP', '<p>Hi {NAME},</p>\n\n<p>Your OTP for withdraw request of {AMOUNT} is {OTP}</p>\n\n<p>If you didn&#39;t request this withdrawal, please ignore this email.&nbsp;</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(64, 'en', 'payment_remainder', 'Remainder', '<p>Hello {EMPLOYER},</p>\n\n<p>{FREELANCER} send you a payment remainder. It looks like you have not made the payment yet, kindly make the payment.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(65, 'en', 'milestone_request_accept', 'Milestone Request Accepted', '<p>Hello {FREELANCER}</p>\n\n<p>{EMPLOYER} has accepted your milestone request. You can now request for payment.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(66, 'en', 'milestone_request_reject', 'Milestone Request Reject', '<p>Hello {FREELANCER}</p>\n\n<p>{EMPLOYER} has rejected your milestone request.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(67, 'en', 'payment_release', 'Payment Release', '<p>Hello {name}</p>\n\n<p>You have successfully received $ {amount} for project {title}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n\n<p>&nbsp;</p>\n', ''),
(68, 'en', 'payment_release_employer', 'Payment Release', '<p>Hello {name}</p>\n\n<p>You have successfully released&nbsp; $ {amount} for the project {title} .</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(69, 'en', 'project_fund_escrowed', 'Fund Escrowed', '<p>Project amount successfully escrowed for project {PROJECT_TITLE}.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(70, 'en', 'project_stopped', 'Project Stop', '<p>Hiii ,</p>\n\n<p>We&#39;re sending this email to inform you that project <strong>{PROJECT}</strong> has been stopped because of insufficent balance in project deposit.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(71, 'en', 'contract_end', 'Contract End', '<p>Hello {FREELANCER},</p>\n\n<p>Your contract for the project {PROJECT} has been ended.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(72, 'en', 'review_freelancer', 'Review', '<p>Hello {FREELANCER},</p>\n\n<p>{EMPLOYER} give you rating . To view your rating, you must rate your freelancer first.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(73, 'en', 'review_employer', 'Review', '<p>Hello {EMPLOYER},</p>\n\n<p>{FREELANCER} give you rating.</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(74, 'en', 'withdrawl_request_user', 'Withdraw Request', '<p>Hello {name},</p>\n\n<p>Your withdrawal request has been successfully sent for approval. We will be in touch after our team&#39;s review.&nbsp;</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', ''),
(75, 'en', 'withdraw_request_action', 'Withdraw Status', '<p>Your withdraw request has been {ACTION}</p>\n\n<p>Thank you for your business,</p>\n\n<p>eDesk</p>\n', '');
INSERT INTO `serv_mailtemplate_bkp` (`id`, `langid`, `type`, `subject`, `template`, `status`) VALUES
(1, 'en', 'registration', 'Registration', '<p><strong>Dear {username},</strong></p>\n\n<p>Welcome and thank you for register yourself at our site.</p>\n\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to verify your mail id and active your account or you can copy paste the bellow link to your browser address</p>\n\n<p>{copy_url}</p>\n\n<p><strong>Account Details:</strong></p>\n\n<p>Username: {username}</p>\n\n<p>password: {password}</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Job Bid Corporation</p>\n', 'Y'),
(2, 'en', 'forgot_password', 'Forgot Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\r\n\r\n<p>Somebody requested a new password for your profile.</p>\r\n\r\n<p>Please <a href=\"{url}\">Click Here</a> to reset your password or copy-paste the following url in your browser :</p>\r\n\r\n<p>{url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', 'Y'),
(19, 'en', 'new_job_post', 'A New Job Posted', '<p><strong>Hello Admin,</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>A new job has been posted and waiting for your approval.</p>\r\n\r\n<p>Job Title : {title}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(3, 'en', 'change_password', 'Password Change', '&lt;p&gt;&lt;strong&gt;Dear {username},&lt;/strong&gt;&lt;/p&gt;\\r\\n&lt;p&gt;You successfully change your password. Below are your account details after password change&lt;/p&gt;\\r\\n&lt;p&gt;&lt;strong&gt;Account Details:&lt;/strong&gt;&lt;/p&gt;\\r\\n&lt;p&gt;Username: {username}&lt;/p&gt;\\r\\n&lt;p&gt;password: {password}&lt;/p&gt;\\r\\n&lt;p&gt;&lt;u&gt;&lt;em&gt;&lt;strong&gt;Thanking You&lt;/strong&gt;&lt;/em&gt;&lt;/u&gt;&lt;/p&gt;\\r\\n&lt;p&gt;Site Team&lt;/p&gt;\'', 'Y'),
(4, 'en', 'bid_on_job_for_employe', 'Bid On Your Project', '&lt;p&gt;&lt;strong&gt;Dear {username},&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;{freelancer} bid on the project {project}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Bid Details:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Project Name: {project}&lt;/p&gt;\r\n&lt;p&gt;Project Url: {project_url}&lt;/p&gt;\r\n&lt;p&gt;Amount: {amount}&lt;/p&gt;\r\n&lt;p&gt;Duration: {duration} days&lt;/p&gt;\r\n&lt;p&gt;&lt;u&gt;&lt;em&gt;&lt;strong&gt;Thanking You&lt;/strong&gt;&lt;/em&gt;&lt;/u&gt;&lt;/p&gt;\r\n&lt;p&gt;Site Team&lt;/p&gt;', 'Y'),
(5, 'en', 'bid_reverse_for_employe', 'Reverse Bid On Your Project', '&lt;p&gt;&lt;strong&gt;Dear {username},&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;{freelancer} revice his bid on the project {project}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Bid Details:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Project Name: {project}&lt;/p&gt;\r\n&lt;p&gt;Project Url: {project_url}&lt;/p&gt;\r\n&lt;p&gt;Amount: {amount}&lt;/p&gt;\r\n&lt;p&gt;Duration: {duration} days&lt;/p&gt;\r\n&lt;p&gt;&lt;u&gt;&lt;em&gt;&lt;strong&gt;Thanking You&lt;/strong&gt;&lt;/em&gt;&lt;/u&gt;&lt;/p&gt;\r\n&lt;p&gt;Site Team&lt;/p&gt;', 'Y'),
(6, 'en', 'bid_on_job_for_freelancer', 'Bid on project', '&lt;p&gt;&lt;strong&gt;Dear {username},&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;You successfully bid on the project {project}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Bid Details:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Project Name: {project}&lt;/p&gt;\r\n&lt;p&gt;Project Url: {project_url}&lt;/p&gt;\r\n&lt;p&gt;Amount: {amount}&lt;/p&gt;\r\n&lt;p&gt;Duration: {duration} days&lt;/p&gt;\r\n&lt;p&gt;&lt;u&gt;&lt;em&gt;&lt;strong&gt;Thanking You&lt;/strong&gt;&lt;/em&gt;&lt;/u&gt;&lt;/p&gt;\r\n&lt;p&gt;Site Team&lt;/p&gt;', 'Y'),
(7, 'en', 'bid_reverse_for_freelancer', 'Reverse Bid On Project', '&lt;p&gt;&lt;strong&gt;Dear {username},&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;You successfully revice your bid on the project {project}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Bid Details:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Project Name: {project}&lt;/p&gt;\r\n&lt;p&gt;Project Url: {project_url}&lt;/p&gt;\r\n&lt;p&gt;Amount: {amount}&lt;/p&gt;\r\n&lt;p&gt;Duration: {duration} days&lt;/p&gt;\r\n&lt;p&gt;&lt;u&gt;&lt;em&gt;&lt;strong&gt;Thanking You&lt;/strong&gt;&lt;/em&gt;&lt;/u&gt;&lt;/p&gt;\r\n&lt;p&gt;Site Team&lt;/p&gt;', 'Y'),
(9, 'en', 'upgrade_membership', 'SMECLUB: Upgrade Membership', '<p>Hello {username},</p>\r\n\r\n<p>Your membership in SME Club is now apgraded to your existing memebership plan.&nbsp;</p>\r\n\r\n<p>Membersihp Plan: {plan}.</p>\r\n\r\n<p>Membersihp Start: {start}.</p>\r\n\r\n<p>Membersihp End: {end}.</p>\r\n\r\n<p>Thank you.</p>\r\n', ''),
(10, 'en', 'degrade_membership', 'SMECLUB: Free Membership', '<p>Hello {username},</p>\r\n\r\n<p>This is inform to you that your membership plane is now over and your are now a free member.</p>\r\n\r\n<p>Please upgrade your account to avail more features.</p>\r\n\r\n<p>Thank You.</p>\r\n', ''),
(11, 'en', 'reference', 'Add Reference', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard. You has been referenced in Virtualbuddy for {username}at our site.</p>\r\n\r\n<p>Please&nbsp;<a href=\"{copy_url}\"><strong>Click Here</strong></a>&nbsp;to give feedback about {username} if you know this person or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(12, 'en', 'invite', 'Invite Friend ', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard. You has been invited in SMEClub by {username} on below mentioned project:</p>\r\n\r\n<p>Project name: {project_name}</p>\r\n\r\n<p>Please?<a href=\"{copy_url}\"><strong>Click Here</strong></a>?to view this project and work on this project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(13, 'en', 'contact_support', 'Your request is submitted', '<p><strong>Dear {name},</strong></p>\n\n<p>Welcome and thank you for contact us at jobbid.org.</p>\n\n<p>Your mail id is: {email}</p>\n\n<p>Your support ticket number is: {ticket} and use it for any future reference.</p>\n\n<p>We will soon be in touch with you.</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Site Team</p>\n', ''),
(14, 'en', 'contact_request', 'New Support Request', '<p><strong>Hello Admin,</strong></p>\n\n<p>Welcome again. A new support request has been submitted. Please gone through below details:</p>\n\n<p>Name: {name}</p>\n\n<p>Mail Id: {email}</p>\n\n<p>Subject: {subject}</p>\n\n<p>Message: {message}</p>\n\n<p>Support ticket number: {ticket}.</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Site Team</p>\n', ''),
(15, 'en', 'invite_freelancer', 'Invite Freelancers', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard. You has been invited in SMEClub by {username} on below mentioned project:</p>\r\n\r\n<p>Project name: {project_name}</p>\r\n\r\n<p>Please?<a href=\"{copy_url}\"><strong>Click Here</strong></a>?to view this project and work on this project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(16, 'en', 'withdraw_payment_request_for_freelancer', 'Withdraw Payment Confirmation', '<p><strong>Dear {username},</strong></p>\r\n\r\n<p>This is to informe you that your withdraw request amount (&nbsp;<strong>{cur}</strong> <strong>{</strong>amount<strong>}&nbsp;</strong>) approve from SME Club Support.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(17, 'en', 'close_account_admin', 'Close Account By User', '<p><strong>Hi Admin,</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>One user {<strong>username</strong>} has closed his/her account.</p>\r\n\r\n<p>Reason : {<strong>reason</strong>}</p>\r\n\r\n<p><strong>Account Details:</strong></p>\r\n\r\n<p>Username: {username}</p>\r\n\r\n<p>user id: {user_id}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(18, 'en', 'close_account', 'Close Account', '<p><strong>Hi {username},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>You has been close your account successfully.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(20, 'en', 'admin_approve_job', 'Job Approved by Admin', '<p><strong>Hello,</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>Your new postedjob has been approved by admin. Now your job goes live!.</p>\r\n\r\n<p>Freelancers can bid on your project.</p>\r\n\r\n<p>Job Title : {title}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(21, 'en', 'dispute_notification', 'A New Dispute', '<p><strong>Hello Admin,</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>A new dispute has been posetd on project: {title} by its client.</p>\r\n\r\n<p>Please check your dispute list for more details.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(22, 'en', 'edit_job_notification', 'Project Edit Notification', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome aonboard.</p>\r\n\r\n<p>A project, {title} has been modified by its client.</p>\r\n\r\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to view details of this project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(23, 'en', 'close_job_notification', 'Job Closed', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome aonboard.</p>\r\n\r\n<p>A project, {title} has been closed by its client.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(24, 'en', 'extend_job_notification', 'Job Extended', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>A project, {title}, expirey date has been extended by its client.</p>\r\n\r\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to view details of this project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(25, 'en', 'select_job_notification', 'You have been selected', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>You have ben selected for work on this project, {title}by its client.</p>\r\n\r\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to view details of this project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(26, 'en', 'process_job_notification', 'Provider Chosen, Job Closed', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>One Provider has been chosen for work on this project, {title}.This project is now closed. You can bid on another projects.</p>\r\n\r\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to view all project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
