(28, 'en', 'decline_offer_notification', 'Project Offer Declined', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>Your project offer on ,{title} has been declined by {<strong>username</strong>}.</p>\r\n\r\n<p>Your project status is now open and providers can bid on your project again.</p>\r\n\r\n<p>Please visit your profile for more details.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(29, 'en', 'milestone_set_notification', 'Milestone is Set', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>A milestone has been set for the project ,{title} by its Bidder.</p>\r\n\r\n<p>Please visit your profile for more details.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
