(35, 'en', 'bid_limit_notification', 'Bid limit exhausted', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>You have just completed quota of your bids limit. Please upgrade your membership plan for bids on more job.</p>\r\n\r\n<p>Please visit your profile for more details.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
