(41, 'en', 'milestone_approved_notification', 'Approved Milestone', '<p>Hello {name},</p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>Congratulation!!</p>\r\n\r\n<p>Client&nbsp;have been approved your milestone for project?{title}.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
(42, 'en', 'milestone_decline_notification', 'Decline Milestone', '<p>Hello {name},</p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>Client have been decline your milestone for project {title}.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', ''),
