(47, 'en', 'pm_alert', 'New Message Notification', '<p>Dear {name}<strong>,</strong></p>\r\n\r\n<p>Welcome onboard.</p>\r\n\r\n<p>You have a new message in your profile.</p>\r\n\r\n<p>Please visit your profile for more details.</p>\r\n', ''),
(48, 'en', 'invite_user', 'Invite User', '<p><strong>Dear {name},</strong></p>\r\n\r\n<p>Welcome onboard. You has been invited by Elance-Sbr on below mentioned project:</p>\r\n\r\n<p>Project name: {project_name}</p>\r\n\r\n<p>Please?<a href=\"{copy_url}\"><strong>Click Here</strong></a>?to view this project and work on this project or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n\r\n<p>?</p>\r\n', ''),
(49, 'en', 'job_closed_notification', 'Job Closed Notification', '<p>Hello {name},</p>\n\n<p>Welcome onboard.</p>\n\n<p>Client closed the job for project {title}.</p>\n\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Site Team</p>\n', ''),
(50, 'en', 'affiliate_reg', 'Affiliate Registration', '<p><strong>Dear {username},</strong></p>\r\n\r\n<p>Welcome and thank you for register yourself at our site.</p>\r\n\r\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to verify your mail id and active your account or you can copy paste the bellow link to your browser address</p>\r\n\r\n<p>{copy_url}</p>\r\n\r\n<p><strong>Account Details:</strong></p>\r\n\r\n<p>Username: {username}</p>\r\n\r\n<p>password: {password}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Job Bid Corporation</p>\r\n', 'Y'),
(51, 'en', 'affiliate_forgot_password', 'Affiliate Forgot Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\r\n\r\n<p>Somebody requested a new password for your profile.</p>\r\n\r\n<p>Please <a href=\"{url}\">Click Here</a> to reset your password or copy-paste the following url in your browser :</p>\r\n\r\n<p>{url}</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', 'Y'),
(52, 'en', 'affiliate_reset_password', 'Reset Password', '<p><strong>Dear </strong>{username}<strong>,</strong></p>\r\n\r\n<p>Your profile password has been changed successfully. Please visit your profile .</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', 'Y'),
(53, 'en', 'manual_hour_request_freelancer', 'Manual hour requested by freelancer', '<p><strong>ar {username},</strong></p>\r\n\r\n<p>{freelancer} requested manual hour for the project {project}. Check your project dashboard.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', 'Y'),
(54, 'en', 'manual_hour_request_accepted', 'Manual hour request accepted', '<p><strong>Dear {username},</strong></p>\r\n\r\n<p>Requested manual hour for the project {project} has been accepted. Check your project dashboard.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n\r\n<p>job bid corporation</p>\r\n', 'Y'),
(55, 'en', 'manual_hour_declined_employer', 'Manual hour request declined by employer', '<p><strong>Dear {username},</strong></p>\r\n\r\n<p>Requested manual hour for the project {project} has been declined by Employer. Check your project dashboard.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>\r\n', 'Y'),
(56, 'en', 'manual_hour_declined_freelancer', 'Manual hour request declined by freelancer', '<p><strong>Dear {username},</strong></p>\r\n\r\n<p>Requested manual hour for the project {project} has been declined by Freelancer. Check your project dashboard.</p>\r\n\r\n<p><u><em><strong>Thanking You</strong></em></u></p>\r\n\r\n<p>Site Team</p>', 'Y'),
(57, 'en', 'endcontractor', 'End Contact Notification', '<p><strong>Dear {NAME},</strong></p>\r\n\r\n<p>{EMPLOYER} end contact with you for the project {PROJECT_NAME}.</p>\r\n\r\n<p>Please go to the site and check the feedback.</p>\r\n\r\n\r\n\r\n<p>Site Team</p>\r\n', 'Y'),
(58, 'en', 'newjobsposted', 'Job Suggestions', '<p><strong>Dear {username},</strong></p>\n\n<p>Hope You are doing well</p>\n<p> we recommend you some jobs as per your skills , your skills are perfectly match with this job</p>\n<p><strong>Job Tittle : {jobtittle},</strong>.</p>\n<p><strong>Category : {category},</strong>.</p>\n<p><strong>Skills Required : {skills},</strong>.</p>\n<p>Please <a href=\"{copy_url}\"><strong>Click Here</strong></a> to apply on this job or just copy and paste  the url given below into your browser </p>\n\n<p><strong>{copy_url}</strong></p>\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Job Bid Corporation</p>', 'Y'),
(59, 'en', 'recontractFreelancer', 'Contract Started', '<p><strong>Dear {username},</strong></p>\n\n<p>Hope You are doing well</p>\n<p> Your Contract For the <a href=\"{copy_url}\"><strong>{jobtittle}</strong></a> has Re-started by client.</p>\n\n\n\n<p><strong>Job URL :</strong><strong>{copy_url}</strong></p>\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Job Bid Corporation</p>', 'Y'),
(60, 'en', 'pausecontractFreelancer', 'Contact has been paused', '<p><strong>Dear {username},</strong></p>\n\n<p>Hope You are doing well</p>\n<p> Your Contract For the <a href=\"{copy_url}\"><strong>{jobtittle}</strong></a> has been  Paused by client.</p>\n\n\n\n<p><strong>Job URL :</strong><strong>{copy_url}</strong></p>\n<p><u><em><strong>Thanking You</strong></em></u></p>\n\n<p>Job Bid Corporation</p>', 'Y'),
(61, 'en', 'email_verification', 'Email Verification', '<p>Hi {NAME},</p>\r\n\r\n<p>click on the below link to verifiy your email</p>\r\n\r\n<p>{LINK}</p>\r\n', ''),
(62, 'en', 'withdraw_otp', 'OTP', '<p>Hi {NAME},</p>\r\n\r\n<p>Your OTP for withdraw request of {AMOUNT} is {OTP}</p>\r\n\r\n<p>If you didn&#39;t request this withdraw then ignore this email.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '');
