(1, '1475494075', 'Developer needed', '<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n', '395', '', '', 'F', 'Public', 'ON', 100.00, 250.00, 0, 'N', '2016-10-03', '2018-02-15', 1, 'Nigeria', 'Port Harcourt', '', '', 'N', 'E', 'N', 'N', 'N', 'N', 0, '', '', '', '2016-10-03 16:57:55', 397, 'N', 'N', 0),
