(86, '1504706266', 'New SEO Project', 'Search engine optimization (SEO) is the process of affecting the visibility of a website or a web page in a web search engine\'s unpaid resultsoften referred to as \"natural\", \"organic\", or \"earned\" results. In general, the earlier (or higher ranked on the search results page), and more frequently a site appears in the search results list, the more visitors it will receive from the search engine\'s users; these visitors can then be converted into customers.[1] SEO may target different kinds of search, including image search, video search, academic search,[2] news search, and industry-specific vertical search engines. SEO differs from local search engine optimization in that the latter is focused on optimizing a business\' online presence so that its web pages will be displayed by search engines when a user enters a local search for its products or services. The former instead is more focused on national searches.', '395', '', 'loader4.gif', 'H', 'Public', 'ON', 3.00, 6.00, 0, 'N', '2017-09-06', '2019-01-19', 240, 'IND', '1358', '229,227,230', '0,0,0', 'N', 'P', 'Y', 'N', 'N', 'Y', 5, '', '', '', '2017-09-06 19:27:46', 396, 'N', 'N', 0),
