(247, '1564104470', 'Data Management Coordinator', 'A boutique non-profit organization serving the needs of higher education is in need of a Data Entry - Data Management Coordinator. This individual will have primary responsibility for reviewing and providing current data and information for the updating of databases and the website. Working with the staff members with primary responsibility in each area, this includes all data sets, publications and pages on the website.\n\nThe ideal candidate for this position will be someone with a strong attention to detail, good internet researching skills, an analytical approach, experienced with Microsoft Office, especially Excel, and methodical. Data entry skills are also necessary.\n\nSpecific duties and responsibilities include:\n\nResearch websites of member organizations for updated information.\nTransfer data from various sources and formats into databases\nMaintain databases by entering new and updated information.\nVerify data by comparing it to the source of the information.\nRetrieve data from the databases as requested\nEducation, Skills and Experience Required for the Data Entry - Data Management Coordinator:\n\nHigh school education required. College degree or college level coursework a plus.\nExperience maintaining and reconciling multiple databases including on-line information, print documents and office based Excel files.\nStrong attention to detail.\nExcellent verbal and written communication skills.\nIn addition to salary in the $55 - 60,000 range, this organization offers:\n\n12% contribution to your 401k retirement account with immediate vesting,\nUp to five week\'s paid time off,\nFully paid healthcare,\nAll federal holidays,\nAdditional generous benefits.\nTo apply, please submit your resume today!\n\nJob Type: Full-time\n\nSalary: $55,000.00 to $60,000.00 /year', '', '', '', 'F', 'Public', 'ON', 10000.00, 25000.00, 0, 'N', '2019-07-26', '2020-12-07', 306, 'USA', '3844', '', '', 'N', 'E', 'N', 'N', 'N',