(248, '1564104561', 'Data Entry Expert - Join our team', 'The data entry clerk performs data entry functions and general office functions within an appraisal project. The data entry clerk must learn the project&rsquo;s appraisal software system and use it to input sketches and other property data into the computer. As a data entry clerk, you may file maps or documents and prepare various items for the field appraisal staff as needed.\n\nEssential Duties and Responsibilities:\n\nOperates keyboard to enter alphanumeric data from source documents into computer following format displayed on screen.\nCompares data entered with source documents to ensure accuracy and completeness.\nReviews system edits and makes corrections as needed.\nStrong analytical skills with the ability to collect, organize, analyze, and disseminate significant amounts of information with attention to detail and accuracy\nReviewing and processing customer and account information by reviewing data for deficiencies; resolving discrepancies by using standard procedures or returning incomplete documents to the Supervisor for resolution.\nVerifies entered customer and account data by reviewing, correcting, or reentering data; combining data from different systems when account information is incomplete\nCommunicates necessary business information or issues to the immediate supervisor or other staff members as appropriate.\nContribute to team effort by accomplishing related results as needed and meeting monthly deadlines.\nOther duties as assigned\nJob Requirements\n\nAbility to enter data quickly and accurately using a standard computer keyboard.\nAbility to comprehend instructions and apply them.\nAbility to work independently.\nThe individual must be responsible and detail-oriented, since accuracy of their entry drives later follow-up.\nFamiliarity with basic computer functions. Ability to type 45-50 WPM\nHigh School Diploma or equivalent', '', '', '', 'F', 'Public', 'ON', 25000.00, 0.00, 0, 'N', '2019-07-26', '2020-12-07', 306, 'USA', '3844', '', '', 'N', 'E', 'N', 'N', 'N', 'N', 0, '', '', '', '2019-07-26 01:29:21', 0, 'N', 'N', 2),
