(253, '1564484854', 'Data Analyst - Entry Level', 'Prepare technical reports by collecting, analyzing and summarizing information and trends\nDetermine operational objectives by studying business functions; gathering information; evaluating output requirements and formats\nParticipate in improvement of master data management process.\nDevelop informative, actionable and repeatable reporting that highlights relevant business trends and opportunities for improvement\nSupport the company\'s growth and financial goals by performing data mining and analysis that impacts foundational pricing and risk assumptions\nConduct market research analysis to support strategic initiatives and provide opportunities for growth, progress, and change\nEnsure and measure master data integrity\nInteract with executives, managers, subject matter experts and development teams\nAssist the Sr. Business Analyst with the planning and budgeting process.\nRequirements of the Entry Level Data Analyst:\n\nBachelor\'s degree - all majors encouraged to apply\nAbility to handle multiple tasks and meet deadlines, while maintaining focus in an environment with conflicting demands and priorities\nStrong analytical skills with ability to work collaboratively and individually to find the best possible solutions\nAbility to communicate complex situations clearly and simply by listening actively and conveying difficult messages in a positive manner\nProficiency with technology, specifically programs like Microsoft Word and Microsoft Excel', '', '', '', 'F', 'Public', 'ON', 2500.00, 5000.00, 0, 'N', '2019-07-30', '2020-12-11', 316, 'USA', '3844', '', '', 'N', 'O', 'Y', 'N', 'N', 'N', 0, '', '', '', '2019-07-30 11:07:34', 0, 'N', 'N', 1),
(250, '1564105597', 'Software Developer', 'We are currently looking for Entry Level Software Developer position.\n\nResponsibilities:\n\nDevelop, convert, and migrate applications from legacy platforms using a variety of programming languages.\nBuild, manage, and continuously improved the build infrastructure for global software development.\nAssist in redesign and architecture of AWS optimized cloud systems, including migrating code bases and refactoring\nParticipate in design, code, and test inspections throughout the life cycle to identify issues/defects; participate in other meetings.\nDevelop and implement an agile SDLC and refinement of the Software Configuration Management (SCM) infrastructure.\nQualifications:\n\nBachelors or Master&rsquo;s Degree in Computer Science, Computer Engineering, Computer Information Systems, , Information Technology or related technical program.\n0-1 years of IT experience in core development functional areas like source code management, build &amp; deploy, programming, automation and scripting functions.\nGood Knowledge in Programming language is required.\nGood communication and co-ordination skills\nJob Type: Full-time\n\nSalary: $68,000.00 to $78,000.00 /year', '', '', '', 'H', 'Public', 'ON', 25.00, 35.00, 37, 'N', '2019-07-26', '2020-12-07', 306, 'USA', '3844', '', '', 'N', 'E', 'N', 'N', 'N', 'Y', 1, '', '', '', '2019-07-26 01:46:37', 0, 'N', 'N', 1),
