(254, '1564485065', 'Research Analyst', 'Scope and define research projects in partnership with internal and external stakeholders that deliver actionable findings to evaluate ancillary business opportunities that increase organizational profitability.\nIn coordination with internal stakeholders, apply data management skills to manage and/or compile large complex research datasets from multiple formats (e.g. consumer surveys, data series, customer data, operational data, etc.) and multiple sources (e.g. Salesforce, SSB, Tableau, external research partners and other APIs as necessary).\nLead and execute in-depth analytical projects based on various data sources, including primary and secondary data, using advanced research methodologies and statistical techniques.\nCommunicate results in a manner that will be easily understood by non-technical professionals, including advising business units or senior management on how to best use research findings.\nCreate quantitative metrics and tracking systems to set and measure progress toward achieving strategic initiatives and defining success.\nDevelop and maintain role-based survey platform dashboards for executives and functional managers tracking key performance indicators across multiple departments.\nReview, analyze, and summarize external reports and research studies (e.g. National Football League reports, Las Vegas Visitors and Convention Authority research reports, etc.) as needed to ensure pertinent information is summarized, shared, and considered by internal stakeholders.\nNegotiate with external vendors for dataset and analytical resources while minimizing spend.\nReview and provide other internal work product as needed.\nAll other duties as assigned.', '', '', '', 'H', 'Public', 'ON', 25.00, 40.00, 30, 'N', '2019-07-30', '2020-12-11', 316, 'USA', '3844', '', '', 'N', 'O', 'Y', 'N', 'N', 'Y', 1, '', '', '', '2019-07-30 11:11:05', 0, 'N', 'N', 1),
(255, '1564489230', 'Research Assistant', 'Coordinate and assist in the completion of research and evaluation projects under the direction of a Principal Investigator/Research Manager.\nAssist in the development layout and testing of survey instruments and other survey materials for phone, mail, and online surveys.\nDevelop and format sample lists.\nCoordinate group meetings and focus groups, identifying sites, confirming and reminding participants, managing logistics, etc.\nEnter responses into survey software and scan paper surveys.\nRead and interpret verbatim comments to open-ended survey questions and code them into groups of like topics or issues.\nAssist with data analysis and reporting.\nPrepare charts and graphs and help write, edit and proof\nConduct secondary online research\nConduct literature reviews and online searches\nAssist with focus groups including coordinating outside facilities, A/V needs, hosting groups and assisting with reporting\nAssist in the preparation of research proposals as needed (proofing, formatting, printing, packaging)', '', '', '', 'H', 'Public', 'ON', 10.00, 20.00, 15, 'N', '2019-07-30', '2020-12-11', 316, 'USA', '3844', '', '', 'N', 'O', 'Y', 'N', 'N', 'Y', 1, '', '', '', '2019-07-30 12:20:30', 0, 'N', 'N', 1),
(256, '1564628582', 'Data Management', 'Assess and cultivate long-term strategic goals for BI and application development in conjunction with end users.\nDesign, code, test, and document all new or modified applications, and programs.\nDevelop reports, and report definitions.\nDevelop graphs and portal interfaces.\nAnalyze user requirements and design functional specifications for BI and other applications.\nWork with project managers to ensure that data entry, retrieval, changes meet business requirements for project completion.\nWork with end users to identify, create, and deliver reports according to requirements.', '', '', '', 'H', 'Public', 'ON', 10.00, 25.00, 25, 'N', '2019-08-01', '2020-12-13', 317, 'USA', '3957', '', '', 'N', 'O', 'Y', 'N', 'N', 'Y', 1, '', '', '', '2019-08-01 03:03:02', 0, 'N', 'N', 1),
(257, '1564628691', 'Data Specialist', 'Provides high-level administrative support to the Head Start Director though administration of a Client Management software that includes a plan for collecting, monitoring, analyzing, applying, and reporting of data.\nManages the Head Start Client Management Software and provides direct support to managers in the collection and reporting of data.\nAssists staff in developing data collecting tools such as surveys, protocols for observations, interviews, and focus groups.\nProvides technical support to program staff in identifying evaluation outcomes, developing data collection methods, and reporting results. i.e. family partnership goals, child outcomes, etc.', '', '', '', 'H', 'Public', 'ON', 12.00, 18.00, 30, 'N', '2019-08-01', '2020-12-13', 317, 'USA', '3957', '', '', 'N', 'O', 'Y', 'N', 'N', 'Y', 1, '', '', '', '2019-08-01 03:04:51', 0, 'N', 'N', 1),
(258, '1564628813', 'Data Conversion Specialist', 'Login to remote DMS to extract and download system data for conversion\nRun conversion programs to clean and translate data into the DMS\nWork with installers to validate data from remote systems in the DMS (Saturday &amp; Sunday)\nTroubleshoot and fix problems that come up during the validation process', '', '', '', 'H', 'Public', 'ON', 20.00, 35.00, 20, 'N', '2019-08-01', '2020-12-13', 317, 'USA', '3957', '', '', 'N', 'O', 'Y', 'N', 'N', 'Y', 1, '', '', '', '2019-08-01 03:06:53', 0, 'N', 'N', 1),
(259, '1564628984', 'Data Specialist', '* Complete, audit and certify program eligibility and related documentation;\n\n* Prepare and distribute program intake and enrollment forms;\n\n* Set up and maintain confidential online and manual client files of program\n\nparticipants, program documentation, available resources, regulatory, and\n\nother program information;\n\n* Use a variety of computer software to enter, track, retrieve and format data for\nroutine and ad-hoc reports, case manager inquiries, grant applications,\npresentations and documentation;\n* Read and interpret Federal, State and grantor documents, policies and procedures\nand routine correspondence;\n* Insure compliance with all related Federal, State and grantor regulations and\nrequirements;', '', '', '', 'H', 'Public', 'ON', 15.00, 25.00, 25, 'N', '2019-08-01', '2020-12-13', 317, 'USA', '3957', '', '', 'N', 'O', 'Y', 'N', 'N', 'Y', 1, '', '', '', '2019-08-01 03:09:44', 0, 'N', 'N', 1);
